import React from "react";
import Navbar from "../NavBar/navBar";
import { Box } from "@mui/material";
function NotFound() {
  return (
    <div>
      <Navbar />
      <Box sx={{ fontSize: 35, fontWeight: 800 }}>this page Not Found</Box>
    </div>
  );
}

export default NotFound;
